module.exports = assignmentParser;

var parser = require('Parser');

function assignmentParser(p){
    var data = {};
    
    //console.log("test: " + solutionFormat);
    p.getLine();
    p.getLine();
    p.getLine();
    var numStudents = p.getSecondPart();
    console.log("Num :) Students: " + numStudents);
    for(i=0; i<numStudents;i++){
        //console.log("in + " + i);
        var email = p.getLine();
        var time = p.getLine();
        p.getLine();
        if(typeof data[time] === 'undefined'){
            data[time] = [];
            data[time].push(email);
        }else{
            data[time].push(email);
        }
    }
    //console.log("Some data: ");
    //console.log(data);
    return data;
}